window.bookSummaryJSON = "<p><b>There's more to my brother's murder than I realized....</b></p> <p>Shadows in the halls, mysteries lurking around every corner. Whoever killed him is covering their tracks well.</p> <p>And now, I'm walking a dangerous line between getting close to the four kings for information and wanting to crawl deeper under their skin for my own desires.</p> <p>I can't trust anyone.</p> <p>I can't let my guard down.</p> <p>And I must keep the urges of my body separate from my heart.</p> <p>But I'm starting to break all of my own rules.</p> <p>I just hope I'm not falling for my brother's killer.</p>"; 
